// App.js
import React from 'react';
import DarkModeToggle from "./components/DarkModeToggle";

function App() {
    return (
            <div className={`App`}>
                <DarkModeToggle/>
                <header className="App-header">
                    <p>APP</p>
                </header>
            </div>
    );
}

export default App;
